<?php

namespace App\Http\Controllers;

use App\Http\Controllers\Controller;

//DB 연동
use Illuminate\Support\Facades\DB;
use Illuminate\Http\Request;

//Scraping
use Sunra\PhpSimple\HtmlDomParser;
use Ivory\GoogleMap\Services\Geocoding\Geocoder;
use Ivory\GoogleMap\Services\Geocoding\GeocoderProvider;
use Geocoder\HttpAdapter\CurlHttpAdapter;

class HomeController extends Controller {
    public $classDataInfo = array();
    
    public function update()
    {
        // init the resource
        //페이지 URL
        $url = "http://sugang.inha.ac.kr/sugang/SU_51001/Lec_Time_Search.aspx";
        //정보통신공학과일 때의 정보 저장
        $postData = array(
            '__VIEWSTATE' => '',
            '__VIEWSTATEGENERATOR' => 'C62F3353',
            '__EVENTVALIDATION' => '',
            'ddlDept' => '1185283'
        );
        $postOutput = $this->postPage($url, $postData);
        $html = HtmlDomParser::str_get_html( $postOutput );
        
        $tableArray = $html->find("table", 0);
        for($i=0;$i<1810;$i++){
            $this->classDataInfo[$i] = iconv("EUC-KR", "UTF-8", strip_tags($tableArray->find('td[class=Center]',$i)));
        }
        $count=0;
        while($count<1810){
            DB::table('inha_sugang')->insert(
               ['subnum' => $this->classDataInfo[0+$count], 'subgroup'=> $this->classDataInfo[1+$count], 'subname' => $this->classDataInfo[2+$count], 'grade' => $this->classDataInfo[3+$count], 'credit' => $this->classDataInfo[4+$count], 
                'classification' => $this->classDataInfo[5+$count], 'time' => $this->classDataInfo[6+$count], 'professor' => $this->classDataInfo[7+$count], 'evaluation' => $this->classDataInfo[8+$count], 'note' => $this->classDataInfo[9+$count]
                ]
            );
            $count+=10;
        }
    }

    public function postPage($url, $postData) {//page 게시
        // init the resource
        $ch = curl_init(); //cURL handle 생성 혹은 cURL session 초기화(client URL 의미, HTTP/FTP 등의 프로토콜 등에 의해 전송하는 파일들을 위한 command line tool)
        
        curl_setopt_array($ch, array(
            CURLOPT_URL => $url,
            CURLOPT_RETURNTRANSFER => true, // return web page
            #post 관련 설정
            CURLOPT_POST => true,
            CURLOPT_POSTFIELDS => $postData, //정보통신공학과일 때의 정보 데이터 적용
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTPHEADER => array ("Content-Type: multipart/form-data; charset=utf-8")//text/xml에서 multipart/form-data로 변경
        ));//옵션을 배열로 한꺼번에 설정

        
        $output = curl_exec($ch);//실행 후 결과 저장
        
        // free
        curl_close($ch);//핸들러 반환
        
        return $output;//결과 반환
    }

    public function getPage($url) {
        // init the resource
        $ch = curl_init();

        curl_setopt_array($ch, array(
            CURLOPT_URL => $url,
            CURLOPT_RETURNTRANSFER => true,
        ));

        $output = curl_exec($ch);

        // free
        curl_close($ch);

        return $output;
    }
}
?>